function VotingInfo({ info }) {
    return (
        <div>
        Missed Vote Percentage: {info.missed_votes_pct}
        Votes with Party Percentage {info.votes_with_party_pct}
        Votes against Party Percentage: {info.againstParty}
        Total Present Votes: {info.presentVotes}
        Total Votes: {info.totalVotes}
        </div>
    );
}

export default VotingInfo;
